import React from 'react';

const Home = () => {
  return (
    <div className="flex flex-col items-center w-full pt-10">
      <img src="/image/welcome.svg" className="w-5/12" alt="Welcome" />
      <h1 className="text-lg text-gray-600">Select or create new project</h1>
    </div>
  );
};

export default Home;
